import React, { useEffect } from "react";
import { useSelector, useDispatch } from "react-redux";
import { getActualites } from "../redux/actions/actualites";
import { Navbar } from "./Navbar";
import ActualiteCard from "./ActualiteCard";

const Actualitelist = () => {
  const dispatch = useDispatch();
  useEffect(() => {
    dispatch(getActualites());
    /* eslint-disable-next-line */
  }, []);
  const articles = useSelector((state) => state.articles.articales);

  return (
    <div>
      <Navbar />
      {articles && articles.map((el) => <ActualiteCard el={el} />)}
    </div>
  );
};

export default Actualitelist;
